import React from "react";

class ReactNormal extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      name: "React"
    };
  }

  render() {
    return <div> ReactNormal Component
        <input value={this.state.name} />
     </div>;
  }
}

export default ReactNormal;
